import React from "react";
import { Link } from "react-scroll";
import aboutimage from "../images/about.png";
import Typewriter from "typewriter-effect";
function About() {
  return (
    <div id="about">
      <div className="about-image">
        <img src={aboutimage} alt="" />
      </div>
      <div className="about-text">
        <h1>KNOW WHO I AM</h1>
        <h2>
          <Typewriter
            options={{
              strings: [
                "FITNESS COACH",
                "HEALTH COACH",
                "DIET PLANNER",
                "GYM TRAINER",
              ],
              autoStart: true,
              loop: true,
              deleteSpeed: 20,
            }}
          />
        </h2>
        <br></br>
        <p>
          Hi ! My name is Aqib javed , I am a professional Health and Fitness
          coach. i am certified by the well reputed fitness institution of
          America. I have trained and coached more than 100 happy customers and
          they are happy with their result{" "}
        </p>

        <div style={{ display: "flex", flexDirection: "row", marginTop: 20 }}>
          <a
            className="header-btn"
            style={{
              color: "white",
              fontSize: 15,
              marginLeft: 5,
              fontWeight: "bold",
              alignItems: "center",
              justifyContent: "center",
            }}
            target="_top"
            href="mailto:aqib45473@email.address"
          >
            Email
          </a>{" "}
          <a
            className="header-btn"
            style={{
              color: "white",
              fontSize: 15,
              marginLeft: 5,
              fontWeight: "bold",
              alignItems: "center",
              justifyContent: "center",
            }}
            target="_top"
            href="https://www.facebook.com/profile.php?id=100009852467415"
          >
            Facebook
          </a>
        </div>
      </div>
    </div>
  );
}

export default About;
